import React from "react";

export default function Project({ work }) {
  return (
    <div className="column">
      {work.title}
      <div
        id="bigCard"
        onClick="location.href={work.deployed};"
        style="cursor: pointer"
      >
        <img className="project" src={work.image} alt="live concert" />
      </div>
      <a href={work.repo} className="gitLinked" style="">
        Github Repo
      </a>
    </div>
  );
}
